<strong>eshell-output-object-to-target</strong> is a compiled Lisp function in `<code>esh-io.el</code>'.</br>
</br>
(eshell-output-object-to-target <u>OBJECT</u> <u>TARGET</u>)</br>
</br>
Insert <u>OBJECT</u> into <u>TARGET</u>.</br>
Returns what was actually sent, or nil if nothing was sent.
